'use strict';

var React = require("react");
var DomUtils = require("../shared/utils/DomUtils.bs.js");
var ReactDOMRe = require("reason-react/src/ReactDOMRe.js");
var Json_decode = require("@glennsl/bs-json/src/Json_decode.bs.js");
var SA_InactiveStudentsPanel = require("../schools/founders/components/SA_InactiveStudentsPanel.bs.js");
var InactiveStudentsPanel__Team = require("../schools/founders/types/inactive_students_panel/InactiveStudentsPanel__Team.bs.js");
var InactiveStudentsPanel__Student = require("../schools/founders/types/inactive_students_panel/InactiveStudentsPanel__Student.bs.js");

function decodeProps(json) {
  return {
          teams: Json_decode.field("teams", (function (param) {
                  return Json_decode.list(InactiveStudentsPanel__Team.decode, param);
                }), json),
          courseId: Json_decode.field("courseId", Json_decode.string, json),
          students: Json_decode.field("students", (function (param) {
                  return Json_decode.list(InactiveStudentsPanel__Student.decode, param);
                }), json),
          authenticityToken: Json_decode.field("authenticityToken", Json_decode.string, json),
          isLastPage: Json_decode.field("isLastPage", Json_decode.bool, json),
          currentPage: Json_decode.field("currentPage", Json_decode.$$int, json)
        };
}

var props = decodeProps(DomUtils.parseJSONAttribute("sa-students-panel", "data-props", /* () */0));

ReactDOMRe.renderToElementWithId(React.createElement(SA_InactiveStudentsPanel.make, {
          teams: props.teams,
          courseId: props.courseId,
          students: props.students,
          authenticityToken: props.authenticityToken,
          isLastPage: props.isLastPage,
          currentPage: props.currentPage
        }), "sa-students-panel");

exports.decodeProps = decodeProps;
exports.props = props;
